import React from 'react';
import { Flex, Progress, Card, Space, } from 'antd';


export const Charp = () => (
  <Flex style={{ marginTop: 12 }} gap="middle" Horizontal>
   
  
    
   

    <Space direction="vertical" size={10}>
  <Card
    
   
    style={{
      width: 550,
    }}
  >
      <Progress size={20} strokeWidth={20} steps={8} type="dashboard" percent={50} status="active" />
      <p>Card content</p>
      <Progress steps={8} type="dashboard"  percent={70} status="active" />
      <p>Card content</p>
      <Progress steps={8} type="dashboard"  percent={70} status="active" />
    <p>Card content</p>
  </Card>
  
</Space>
  </Flex>
  
)
